def load_json_file(path: str) -> Optional[Dict]:
    """Load JSON file safely.

    Args:
        path: Path to JSON file

    Returns:
        Parsed JSON data or None if error
    """
    try:
        with open(path, 'r') as f:
            return json.load(f)
    except (FileNotFoundError, json.JSONDecodeError):
        return None
